on is not working well and you notice changes in the way it sounds when you shift gears, or if shifting gears is not working as well. In this case you likely have a leak of transmission fluid that is impacting how your transmission operates."}]', 1, 400.00, 0.00, 1, 1, '[{"name":"Child Toddler Seat","price":"100","type":"one_time"},{"name":"Infant Child Seat","price":"100","type":"one_time"},{"name":"GPS Satellite","price":"200","type":"one_time"}]', NULL, 3, 'Auto', 10, 4, 'publish', 1, 6, NULL, NULL, '2022-03-01 18:48:27', '2022-03-01 18:48:41', 4.3, NULL, NULL, NULL, NULL, NULL);
