	(1, 'Paris', 'New York, a city that doesnt sleep, as Frank Sinatra sang. The Big Apple is one of the largest cities in the United States and one of the most popular in the whole country and the world. Millions of tourists visit it every year attracted by its various iconic symbols and its wide range of leisure and cultural offer. New York is the birth place of new trends and developments in many fields such as art, gastronomy, technology,...', 'paris', 106, '48.856613', '2.352222', 12, 'publish', 1, 2, NULL, 1, NULL, NULL, NULL, NULL, '2022-03-01 18:47:12', '2022-03-01 18:47:13', 111, '"[{\\"title\\":\\"Experiencing the best jazz in Harlem, birthplace of bebop\\",\\"link\\":\\"#\\",\\"content\\":\\"New Orleans might be the home of jazz, but New York City is where many of the genre\\u2019s greats became stars \\u2013 and Harlem was at the heart of it.The neighborhood experienced a rebirth during the...\\",\\"image_id\\":\\"112\\"},{\\"title\\":\\"Reflections from the road: transformative \\u2018Big Trip\\u2019 experiences\\",\\"link\\":\\"#\\",\\"content\\":\\"Whether it\\u2019s a gap year after finishing school, a well-earned sabbatical from work or an overseas adventure in celebration of your retirement, a big trip is a rite of passage for every traveller, with myriad life lessons to be ...\\",\\"image_id\\":\\"113\\"}]"'),
